import React, {useEffect, useState} from 'react';
import logo from './logo.svg';

function App() {

  const [items, setItems] = useState([{}]);

  useEffect(() => {
    fetch("/api").then(
      response => response.json()
    ).then(
      items => {
        setItems(items)
      }
    )
  }, []);
  return (
    <div>
      <header>
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hello World
        </p>
      </header>
    </div>
  );
}

export default App;
